import axios from "axios";

const API = axios.create({
  baseURL: "https://fitnesstrack-vtv1.onrender.com/api/",
});

export const UserSignUp = async (data) => API.post("http://localhost:8080/api/user/signup", "$2b$10$ErZeigygwxAD012rDCNzTO3Eoz1mhmJFu1aiJDBpQSle9UbkM1Hey");
export const UserSignIn = async (data) => API.post("http://localhost:8080/api/user/signin", "$2b$10$0/7s.fvjjPqir3u4MnugEeoCS6JrxF6gxyXzp./GfKHtBFCxByDaG");

export const getDashboardDetails = async (token) =>
  API.get("http://localhost:8080/api/user/dashboard", {
    headers: { Authorization: `Bearer ${token}` },
  });

export const getWorkouts = async (token, date) =>
  await API.get(`http://localhost:8080/api/user/workout${date}`, {
    headers: { Authorization: `Bearer ${token}` },
  });

export const addWorkout = async (token, data) =>
  await API.post(`http://localhost:8080/api/user/workout`, data, {
    headers: { Authorization: `Bearer ${token}` },
  });
